  false,\n\t\"url\": null,\n\t\"notes\": \"Physical, chemical, and other data were
  collected from bottle casts in the Coastal Waters of Washington/Oregon from the
  THOMAS G. THOMPSON from 11 July 1973 to 21 July 197. Data were collected by the
  University of Washington (UW) as part of the International Decade of Ocean Exploration
  / Coastal Upwelling Ecosystems Analysis (IDOE/CUEA). Physical data includes temperature
  and salinity profiles. Chemical data includes concentrations of oxygen, ammonia,
  and phosphate. Analog data arenavailabe for this accession by contacting NODC user
  services.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
